import * as THREE from "three";
import { PlayerParams } from "../player/literal";
import { wireframeMaterial } from "../engine/material";
import { Layers } from "../engine";

export function initBoundsHelper() {
  const { radius, height } = PlayerParams;
  const boundsHelper = new THREE.Mesh(
  new THREE.CylinderGeometry(radius, radius, height, 16),
  wireframeMaterial,
  );
  boundsHelper.layers.set(Layers.One);
  return boundsHelper;
}


/**
 *@desc Update the player's bounding cylinder helper
*/
export function updateBoundsHelper(position: THREE.Vector3, boundsHelper: THREE.Mesh) {
  boundsHelper.position.copy(position);
  boundsHelper.position.y -= PlayerParams.height / 2;
}

game/world/generate/tallGrass.__content:
/**
 * Generate random patches of tall grass across the top surface
 */

import { BlockID } from "../../Block";
import { ChunkParams } from "../chunk/literal";
import { IWorldParams } from "../interface";
import { World } from "../World";

export const generateTallGrass = (
  input: BlockID[][][],
  params: IWorldParams
): BlockID[][][] => {
  const { width, height } = ChunkParams;
  const { tallGrass } = params;
  if (!tallGrass) return input;

  for (let x = 0; x < width; x++) {
    for (let z = 0; z < width; z++) {
      // starting from the top of the chunk, find the first grass block
      // if come in contact with leaves, stop since grass doesn't grow under trees
      for (let y = height - 1; y >= 0; y--) {
        if (input[x][y][z] === BlockID.Leaves) {
          break;
        }

        if (input[x][y][z] === BlockID.Grass) {
          // found grass, move one time up
          const baseY = y + 1;

          if (input[x][baseY][z] !== BlockID.Air) {
            continue;
          }

          if (World.rng.random() < tallGrass.frequency) {
            input[x][baseY][z] = BlockID.TallGrass;

            // Define the maximum distance from the center
            const maxDistance = tallGrass.patchSize;

            // Random walk algorithm
            let currentX = x;
            let currentZ = z;
            for (let i = 0; i < maxDistance; i++) {
              const direction = World.rng.random() * 2 * Math.PI; // Random direction
              currentX += Math.round(Math.cos(direction));
              currentZ += Math.round(Math.sin(direction));

              // Check if the new position is within the chunk boundaries and is air
              if (
                currentX >= 0 &&
                currentX < width &&
                currentZ >= 0 &&
                currentZ < width &&
                input[currentX][baseY][currentZ] === BlockID.Air &&
                input[currentX][y][currentZ] === BlockID.Grass
              ) {
                input[currentX][baseY][currentZ] = BlockID.TallGrass;
              }
            }
          }
        }
      }
    }
  }

  return input;
};

game/Block/base/BlockFactory.__content:
import { AirBlock } from "../blocks/AirBlock";
import { BedrockBlock } from "../blocks/BedrockBlock";
import { Block } from "./Block";
import { CoalOreBlock } from "../blocks/CoalOreBlock";
import { DirtBlock } from "../blocks/DirtBlock";
import { FlowerDandelionBlock } from "../blocks/FlowerDandelionBlock";
import { FlowerRoseBlock } from "../blocks/FlowerRoseBlock";
import { GrassBlock } from "../blocks/GrassBlock";
import { IronOreBlock } from "../blocks/IronOreBlock";
import { LeavesBlock } from "../blocks/LeavesBlock";
import { OakLogBlock } from "../blocks/OakLogBlock";
import { RedstoneLampBlock } from "../blocks/RedstoneLampBlock";
import { StoneBlock } from "../blocks/StoneBlock";
import { StoneBrickBlock } from "../blocks/StoneBrickBlock";
import { TallGrassBlock } from "../blocks/TallGrassBlock";

import { BlockID } from "..";

// Flyweight pattern to avoid creating new block instances
export class BlockFactory {
  private static blockTypes: { [id: number]: any } = {
    [BlockID.Air]: AirBlock,
    [BlockID.Grass]: GrassBlock,
    [BlockID.Stone]: StoneBlock,
    [BlockID.Dirt]: DirtBlock,
    [BlockID.Bedrock]: BedrockBlock,
    [BlockID.CoalOre]: CoalOreBlock,
    [BlockID.IronOre]: IronOreBlock,
    [BlockID.OakLog]: OakLogBlock,
    [BlockID.Leaves]: LeavesBlock,
    [BlockID.TallGrass]: TallGrassBlock,
    [BlockID.FlowerRose]: FlowerRoseBlock,
    [BlockID.FlowerDandelion]: FlowerDandelionBlock,
    [BlockID.RedstoneLamp]: RedstoneLampBlock,
    [BlockID.StoneBrick]: StoneBrickBlock,
  };

  private static blockInstances: { [id: number]: Block } = {};

  static getBlock(id: BlockID): Block {
    if (!this.blockInstances[id]) {
      const BlockType = this.blockTypes[id];
      if (BlockType) {
        this.blockInstances[id] = new BlockType();
      } else {
        throw new Error(`No block type registered for ID ${id}`);
      }
    }
    return this.blockInstances[id];
  }

  static getAllBlocks(): Block[] {
    return Object.keys(this.blockTypes).map((id) => this.getBlock(+id));
  }
}

